    return (
        <div className="container">
            <div className="row">
                <div className='col-sm-12 col-lg-6 col-xl-4 '>
                    <div className="card m-1">
                        <div className="card-title">{props.title}</div>
                        <div className="card-content" style={{ height: 200 }}>{props.content}</div>
                    </div>
                </div>
            </div>
        </div>

    );
}
